import { Container, Item } from "./styles";

const FilterMenu = () => {

  const filterItems = ["Tudo", "Ao vivo", "Música", "Jogos", "Downtempo", "React", "Smooth Jazz", "Música instrumental", "HTML5", "House Music", "iPhone", "Piano", "Computadores", "Counter-Strike: Global Offensive", "Música brasileira", "Música", "Música", "Música", "Música", "Música", "Música"];

  return (
    <Container>
      <Item>
        <span>Tudo</span>
      </Item>
      <Item>
        <span>Ao vivo</span>
      </Item>
      <Item>
        Música
      </Item>
      <Item>
        Música Lo-fi
      </Item>
    </Container>
  )
}

export default FilterMenu;
